Card Description:
Tell students there is a pop quiz, but they have to come up with the questions. Example

int x = 0;
if(x = 0){
  System.out.println("Output");
}
What is the output of this program?
a. "Output"
b. nothing
c. Does not compile (answer because of x = 0 instead of x ==0)

Give examples of questions. "If the Driver does not know what to type, the Navigator can take over. T or F"

Give 15 mins for pairs to come up with two questions. Have them write questions on the board.
